[0.625,"rgb(66,146,198)"],[0.75,"rgb(33,113,181)"],[0.875,"rgb(8,81,156)"],[1.0,"rgb(8,48,107)"]],"line":{"color":"rgba(102, 102, 102)","width":1},"opacity":0.7,"size":10,"symbol":"square"},"mode":"markers","text":["Christopher Kinyanjui Kariuki<br>Leuven, Belgium<br><br>The materials will be used for training and research purposes with our<br>colleagues in East Africa, in particular Kenya, Tanzania and Ethiopia.<br>We are therefore very thankful for your kind offer","Jehovani Lopez<br>Brooklyn, United states<br><br>We are a community biolab in brooklyn.","Ivan Slovokhotov<br>Moscow, Russia<br><br>Currently, I'm building different cloning and expression vectors. If<br>you want, I can share them, when they'll be ready.","Mads Kaern<br>Ottawa, Canada<br><br>Very impressive initiative","Isaac Larkin<br>Evanston, United states<br><br>I solemnly swear my BIL will wear this responsibly.","Matthew Thompson<br>Manchester, United kingdom<br><br>-","Melanie Arbour<br>Montreal, Canada<br><br>Thanks a lot for these tools!","Shailendra Vyas<br>New delhi, India<br><br>We are a for profit company and are willing to use these products for<br>the community and making it available at a nominal profit that can<br>sustain our activities.","Dayananda  Chandrappa<br>Bengaluru, India<br><br>We are a deep tech startup based in Bengaluru  working on sustainable<br>and eco-friendly products for Healthcare and environmental industries","Elliott Graham<br>Wolverhampton, United kingdom<br><br>N/A","Miles Rogers<br>Cambridge, United states<br><br>You are a great resource!","Sarah Ware<br>West chicago, United states<br><br>Students were working on the transformations and it seems there has<br>been contamination.  Please re-send :)","\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0428\u0438\u043b\u043e\u0432\u0438\u0447<br>Moscow, Russia<br><br>I wanted to order a T-shirt also, but the website says that more than<br>5 items is forbidden, so I will order it separately","Emiliano Vilardo<br>Rosario, Argentina<br><br>Empty","Paulina Ejsmont<br>Paris, France<br><br>In case you would like to know more about our projects, please our<br>website: https://www.cri-paris.org/en/research","Fernan Federici<br>Macul, Chile<br><br>we love the FreeGenes project would be very happy to help in<br>redistribution within Chile if nedeed","Brody McNutt<br>Boulder, United states<br><br>I would be happy to share materials with others in the future, but I<br>am process of moving and don't know when I will be in a position to do<br>so","Jose Munoz<br>Newcastle upon tyne, United kingdom<br><br>I am interested to characterise new enzyme families and activities for<br>waste conversion into biofuels","Manish Kushwaha<br>Jouy-en-josas, France<br><br>Where possible, we prefer purified DNA rather than glycerol stocks.<br>Thank you!","Hiroyuki Ichida<br>Wako, Japan<br><br>Thank you very much for this fantastic set of genes. This is an<br>essential toolset for newcomers to the field like us.","Jennifer Molloy<br>Cambridge, United kingdom<br><br>Would prefer purified DNA","Zoila E Jurado Quiroga<br>Pasadena, United states<br><br>2nd time ordering, first time transformation did not all work. And kit<br>was incomplete (#28 missing) and given sequence was not accurate to<br>respective part (ex. #16) Thank you for everything.","Fristot Elsa<br>Montpellier, France<br><br>x","Hiroyuki Ichida<br>Wako, Japan<br><br>Great thanks to this fantastic collection!","Shu Li<br>Torrance, United states<br><br>NA","Norhan Hassan<br>Thuwal, Saudi arabia<br><br>Thank you","SERV0223789 CAROLINE  BACQUET <br>Miami, United states<br><br>I am Caroline Bacquet and I teach and do research at University Ikiam,<br>founded 8 years ago in the Ecuadorian Amazon area. Our budget and<br>installations are very limited, so I'm delighted to find these frees<br>resources. We are educating future biotechnology engineers with strong<br>social and environmental values. I'm very thankful for your incredible<br>work and generosity.","kangquan YIN<br>Beijing, China<br><br>currently not any.","Danielle Pedrolli<br>Araraquara, Brazil<br><br>The SynBio Lab at UNESP keeps a plasmid collection that is made<br>available for any Brazilian Lab free of charge upon request.","Fernando Bustos<br>\u00d1u\u00f1oa, Chile<br><br>We are a research and development company that sells kits for biotech<br>and STEM educational kits. We would like to start producing some<br>enzymes to lowers costs of production and make science available to<br>lower income educational establishemnts","Juan Alvarez<br>Calgary, Canada<br><br>I can also be reached through my LinkedIn:<br>https://www.linkedin.com/in/juan-sebastian-alvarez-3bb1b8157/ Was<br>watching the cGEM conference this weekend, and I learned about the<br>work that Friendzymes is doing! That is why I am ordering the<br>b.subtillis toolkit.","Ganesh Prasad<br>Bengaluru, India<br><br>We are start up based out of bangalore, India envisaging the<br>development of molecular biology products and reagents locally so that<br>we can bring down the cost of the reagents so that these become<br>affordable to researchers in india","Wei-Min Chang<br>Taipei, Taiwan<br><br>Thank you so much","Kristel Alman<br>Tartu, Estonia<br><br>The enzyme and reporter collections can be in either glycerol stocks<br>or purified DNA, no preference.","Mariela Escobar<br>Rosario, Argentina<br><br>We are building our molecular biology lab and these kits will be<br>extremely useful for us.","Maira Goytia<br>Atlanta, United states<br><br>Thank you for all your work!","Leandro Oliveira (NG)<br>Cambridge, United kingdom<br><br>I prefer a purified nucleic acids format if possible","Ahmad Suparmin<br>Sleman, Indonesia<br><br>We need all of those in the glycerol stocks form (E. coli glycerol<br>stocks ).","Michael Hudson<br>Harrisburg, United states<br><br>I am using Glowing Plant as a experiment for a demonstration speech<br>and the rest I am going to use this for a research paper.","Stijn Tobias de Vries<br>Marburg, Germany<br><br>If it's easier to send by mail, plasmids are also fine. We can perform<br>the relevant transformations here in high throughput.  Which strain<br>would you recommend for the protein expression of the Open Enzymes<br>kit? We generally use BL21(DE3 ) Codon + RIL for protein expression.<br>Thank you so much in advance!","Reuben Brown<br>Uq, Australia<br><br>You need a permit and a manufacturer's declaration, I have these and<br>will forward them to you. The manufacturer's declaration can be<br>submitted via email to fedex as it needs the tracking number and can<br>be annoying to do at the time of shipping. our fedex account number is<br>\u201c3017-0695-2\u201d feel free to use it.","Emilia Mazza<br>Rosario, Argentina<br><br>i love mushrooms!","Elliot Medina<br>Tampa, United states<br><br>n/a","Ingrid Jaramillo<br>Medellin, Colombia<br><br>I would like to collaborate in this open bioeconomy lab idea.","Maya Bendifallah<br>\u00c9vry-courcouronnes, France<br><br>nothing to add!","Maan Neamah<br>Kufa, Iraq<br><br>Thanks for these materials, it would provide an appreciated help for<br>our research.","Uriel Eleazar Barboza Perez<br>Irapuato, Mexico<br><br>Importing biological material to mexico is quite hard, owing to this I<br>think it might be easier to send the material as DNA rather than<br>glycerol stocks. So purified nucleic acid would be a better format.","Emilia Mazza<br>Rosario, Argentina<br><br>i am from argentina","Ravendran  Vasudevan<br>Cambridge, United kingdom<br><br>Thanks for your service","Bronagh Hogan<br>Thuwal, Saudi arabia<br><br>No other comments","Emiliano Emiliano<br>Rosario, Argentina<br><br>You are awesome and should have more about fungi and less about e coli","Fernando Guzman-Chavez<br>Cambridge, United kingdom<br><br>I hope that more collections can be included in the future.","Wei-Min Chang<br>Taipei, Taiwan<br><br>I just want to say thank you for whole group","Sergen Unal<br>Istanbul, Turkey<br><br>Thank you","Xavier Coadic<br>Rennes, France<br><br>You are an awesome initiative","Richard Jones<br>Lower lake , United states<br><br>Are the plasmids lyophilized?  We should be getting our Ultra low -80<br>freezer in the next month or two.","Ben Thuronyi<br>Williamstown, United states<br><br>Excited about this project!","Rodolfo Marcolino<br>La plata, Argentina<br><br>I find the project very interesting ! Got experience from the_Odin<br>Kits !!! All the Best   Rodolfo","Sergen Unal<br>Istanbul, Turkey<br><br>No Thanks","Esther Kim<br>Pleasanton, United states<br><br>Testing the parts for Scott Pownell.","Carlos  Breyer <br>S\u00e3o paulo, Brazil<br><br>Congratulations on the initiative, it makes research a lot easier","Justin Vaillancourt<br>Vancouver, Canada<br><br>.","Tim Dobbs<br>Paris, France<br><br>Please ship in E.coli if you have successfully shipped GMO cultures to<br>France or The EU previously. Otherwise, ship as DNA. I haven't been<br>able to find a definitive policy for importing GM microorganisms to<br>France, but from past experience I know that sometimes GM strains get<br>held up in customs. So if you are similarly unsure, it may be best to<br>ship as DNA to avoid problems at customs.  Please reach out if you<br>have any questions. Thanks!","Joey Riepsaame<br>Oxford, United kingdom<br><br>I'm a big fan of the BioBrick foundation and have contributed<br>sequences in the past. I'm still very excited about the mammalian<br>promoter library I submitted a while ago. Any chance this will go in<br>production soon?  Also, would it be useful to have a human<br>transcription factor library as described by George Church in the<br>paper below?  https://www.nature.com/articles/s41587-020-0742-6","Joel Graff<br>Butte, United states<br><br>I have a YouTube channel that I haven't done anything with for a<br>while.  I have been thinking about making videos of everyday lab work.<br>However, I have wondered how many people would be interested in<br>learning about my lab's specific research.  I'm interested in these<br>enzymes (and other resources from this organization) because I could<br>see my videos being beneficial to others that may use this collection.<br>Would it be OK to create videos for YouTube to explain how to use<br>these reagents?  (My YouTube channel is \"Life and Biology\" if you<br>would like to check it out.)  Thanks!  -Joel","Caua Westmann<br>Zurich, Switzerland<br><br>I may not use all kits in my own research but I would be extremely<br>happy to have them in the lab for next gen of researchers and also for<br>the local scientific community.","Jonathan Tellechea<br>Valencia, Spain<br><br>Nothing else really.","Han ming Gan<br>Rawang, Malaysia<br><br>THanks for your great work","Sarah Ware<br>West chicago, United states<br><br>NA","John Allan<br>Newcastle upon tyne, United kingdom<br><br>Goan yersel big man","Esteban Erben<br>San martin, Argentina<br><br>Having the chance to produce our own molecular biology reagents will<br>allow us to keep doing great science at low cost. Thanks for<br>contributing!  If possible use Fedex and U$D 1 as declared value. If<br>shipment declares commercial values I can not get it out of the<br>Argentinean custom. In general UPS requires a broker.   I prefer to<br>get the DNA, not glycerol.","Nicole Prandi<br>Cambridge, United kingdom<br><br>.","Ahmad Suparmin<br>Sleman, Indonesia<br><br>I'm a researcher at development country, I pursue more student to do<br>research in my country educate more student about molecular genetic","Renata Fernandes<br>S\u00e3o paulo, Brazil<br><br>nothing to comment","David Chiasson<br>Halifax, Canada<br><br>Thanks for offering this collection!","Gwyn Uttmark<br>Casper, United states<br><br>This is a test order to confirm \"closing the loop\" works.","Brady Baggett<br>Portland, United states<br><br>Purified Nucleic Acid form please. Thank you!","Kulvinder Gill<br>Pullman, United states<br><br>We intend to use the items in our molecular biology lab for research<br>purpose only.","Kyle Mohler<br>West haven, United states<br><br>N/A","Emin Bursa<br>Plano, United states<br><br>please don't require signature for delivery, thank you!","Simran Kushwaha<br>Pilani, India<br><br>Nothing","Jose David Rosales<br>Miranda, Venezuela<br><br>First of all, congratulate them for their support in providing these<br>biotechnological tools. Previously I got the open protein plate and I<br>managed to recover 50% of the clones, I hope they can send me the<br>plate again to recover the rest of the clones. Of the items of<br>Molecular Diagnostics Toolkit I prefer that you send plate # 2, which<br>contains plasmid DNA. Thanks again for your support.","Wilson Teran<br>Bogota, Colombia<br><br>Pandemia had tremendous negative impact on research and teaching<br>activities, in particular for molecular cloning activities as many<br>reagents, enzymes are imported. Importing procedures, for this kind of<br>reagents, usually took 1 month before COVID19, but now this time has<br>increased up to 3 months on average. This hampers any opportunity to<br>work in eitehr research or teaching projects related to molecular<br>cloning, molecular diagnosis, expression profiling, etc.. with young<br>undergraduate students who are amongst the most interested in learning<br>from all latest advances on molecular biology and sharing their<br>knowledge. We are interested in learning more about isothermal<br>ampification (LAMP or RPA) in order to apply these developments for<br>research and molecular diagnosis of crop's diseases, considering all<br>recent developments for low cost or quick testings such as those<br>employed for COVID-19","Ellen Jorgensen<br>South salem, United states<br><br>BSL1 facility","Scott Pownall<br>Vancouver, Canada<br><br>A reminder to Grace to streak three Genscript parts on a plate and<br>include in the shipment. The parts are BBF10K_000059 (Sc_pGAL1),<br>BBF10K_000171 (AB_Sc-pGAL1) and BBF10K_000463 (Sc2micron). The first<br>two had technical issues and were pulled from the current<br>distribution.","Charlie Gilbert<br>Norwich, United kingdom<br><br>Hi there, my name is Charlie Gilbert. I am a research scientist<br>working at Colorifix Ltd. We are a growing biotech/synbio company<br>based in Norwich, UK. We use synthetic biology to engineer microbes to<br>produce dyes for the textile and fashion industry and want to use our<br>approach to improve the environmental sustainability of the dyeing<br>process. The open yeast kit would be of great use to us in<br>establishing yeast synthetic biology tools and approaches.","Dongyan Niu<br>Calgary, Canada<br><br>N/a","Jimmy Gledson Hayden Linhares<br>Manaus, Brazil<br><br>I have requested that kit and it was sent in glycerol stock, but our<br>lab couldn't recover any bacteria - probably 'cause they spent too<br>much time on Brazilian transport facilities. We would appreciate if<br>you could send it as nucleic acid. Best regards.","Lorenzo Zolfanelli<br>Paris, France<br><br>I am doing research on adaptive immunity as part of my PhD. I am also<br>involved an free software and open science movements, and I am trying<br>to communicate and diffuse a free (as in \"speech\", not \"beer\") culture<br>and mindset inside and outside my lab.","Benjamin Chavez<br>Gatersleben, Germany<br><br>I am in Germany so it will probably be much easier if we receive<br>plasmids if possible rather than glycerol stocks.","Jimmy Linhares <br>Manaus, Brazil<br><br>.","Zhiyong Lei<br>Utrecht, Netherlands<br><br>n.a.","Ian Cubit<br>Hagerstown, United states<br><br>That's about it! I had a bad time trying to culture pBUILD, but<br>everything else has been beautiful. Thank you!","Jordan Gonzalez<br>Pittsburgh, United states<br><br>N/A.","Kefentse Arnold Tumedi<br>Gaborone , Botswana<br><br>Recombinat DNA technology laboratory Researcher at Botswana Institute<br>for Technology Research and Innovation","Phil Roche<br>Mont-royal, Canada<br><br>glad these are available for education and open research","Joshua Maurer<br>Watervliet, United states<br><br>N/A","Angelica Hernandez<br>Metepec, Mexico<br><br>-","Leandro Oliveira (NG)<br>Cambridge, United kingdom<br><br>I am a professor at the Universidade Federal de Vi\u00e7osa in Brazil. I am<br>now a visiting researcher at University of Cambridge. I plan to start<br>using the toolkits in Cambridge and take them to Brazil.","Zoila E Jurado Quiroga<br>Pasadena, United states<br><br>Nothing","Shree Ram Singh<br>Montgomery, United states<br><br>We will like to one day payback in some manner in whatever little we<br>can to Freegenes for their efforts for making biotechnology open to<br>all.","Aleksandr Shilovich<br>Moscow, russia, Russia<br><br>It is nice to know that there are people who share the spirit of<br>international collaboration!","Phil Roche<br>Mont-royal, Canada<br><br>Glad this opens bio research for all","Jennifer Hsieh<br>Puerto varas, Chile<br><br>I'm not sure how Chile customs deals with glycerol stocks. Normally we<br>get lyophilized DNA without problems, but I see that you have<br>delivered to Chile before and assume you know what to put on the<br>shipment page?     Thank you so much, if we can grow just some of<br>these enzymes ourselves it'd really help us decrease the cost of<br>development (which, naturally, is taking much longer than anyone ever<br>anticipates)","Neil Singh<br>G\u00f6ttingen, Germany<br><br>How will these items be shipped?  Is it the complete proteome?  What<br>are the downstream steps to be followed for gene extraction?  Would<br>you include the extre genes in Syn-3A?","Ian Cubit<br>Hagerstown, United states<br><br>Thank you!","Matthew Phanchana<br>Ratchathewi, Thailand<br><br>Replacement for order which arrived with the plate seal breached.<br>Original customer note follows:  I'm a lecturer at the Faculty of<br>Tropical Medicine Mahidol University in Thailand where we conduct<br>research in medical biosciences and provide postgraduate education. I<br>heard about the freegenes project f ng this phase. I plan to use these requested<br>material for regular r&d work. The no of covid patients are again<br>Increasing and if we have to run testing again these reagents will be<br>extremely helpful.","William Brett<br>Stony brook, United states<br><br>Through google search to find Pfu-Sso7d plasmid. Willing to<br>redistribute the items locally (institutionally at stony brook<br>university)","Jordan Gonzalez<br>Pittsburgh, United states<br><br>I heard about FreeGenes from the work of Jake Wintermute. I am<br>currently an undergraduate student doing independent research. I have<br>a love for spreading biology and making it more accessible so I was<br>ecstatic to see such a wonderful program for free gene exchange.","Eric Theis<br>Mount pleasant, United states<br><br>This is my second order, I was highly satisfied with the first but<br>there was contamination in the lab and many of the running plasmid<br>dishes were contaminated, and we'd like another opportunity to correct<br>our mistake and continue our research.","Lukas  Denkhaus<br>Freiburg im breisgau, Germany<br><br>My name is Lukas, I'm a PhD student at the University of Freiburg,<br>Germany. I was looking for a plasmid containing the gene of the<br>nuclease DpnI to produce the enzyme in our lab and came across<br>Freegenes. I'm pretty surpirsed that I never heard of your<br>organization before, eventhough it is easy to find on Google. I think<br>what you do is a great means to distribute materials and knowledge.<br>Many thanks,  Lukas","semih cagan<br>Sultangazi/i\u0307stanbul, Turkey<br><br>Hi, I am Semih. I am studying bioengineering at Yildiz Technical<br>University. I just started genetic engineering in my home. I got a<br>YouTube channel which I am telling what I do. Here is the link of it:<br>youtube.com/c/Mutantik/videos . I would like to use CRISPR on plants<br>but I know, I should be more experienced. So, I am going to work on<br>microorganisms till I learn. That is why I need your items. I saw this<br>website when I was searching about biohacking communities. Giving<br>genes for free is really helpful for biohackers like me. Thank you for<br>doing this. Have a nice day...","John Allan<br>Newcastle upon tyne, United kingdom<br><br>First heard about Free Genes at SB7 and have followed the project<br>since. I am a post doc in the Hub for Biotech in the Built Environment<br>at Northumbria University in the UK. We intend to do some work with<br>the Open Enzyme Collection to develop new protocols for rapid and<br>reliable production of these enzymes.","Matthew Phanchana<br>Ratchathewi, Thailand<br><br>I'm a lecturer at the Faculty of Tropical Medicine Mahidol University<br>in Thailand where we conduct research in medical biosciences and<br>provide postgraduate education. I heard about the freegenes project<br>from a colleague and I think it's a great tool kit for research and<br>education. We plan to use and share these materials within our<br>department, faculty and our collaborator network.","Rita Chen<br>Boston, United states<br><br>Hello, The Free Genes Project,     My name is Rita Chen, the<br>laboratory specialist at DAMP Lab. Our lab is a DNA foundry and core<br>facility of Boston University that focus on design, automation,<br>manufacture, and prototyping.     The DAMP lab is interested in doing<br>a fun BioArtBot-like project (http://www.bioartbot.org/about), and we<br>need some colorimetric strains as part of the project. We heard about<br>the Free Genes Project through the Counter Culture Labs and would be<br>interested in receiving some reporter plasmids that will be used as<br>part of our project. Eventually, this project will become part of our<br>outreach programs for high school students from the neighboring<br>communities.      Best regards,   Rita","Louise Dalgaard<br>Roskilde, Denmark<br><br>I heard of Stanford Free Genes from a News and Views item in the<br>journal Nature.","Fernando Guzman<br>Cambridge, United kingdom<br><br>One of the contributors is our colleague at the University of<br>Cambridge","Travis Wertz<br>Boise, United states<br><br>I've ordered previously. Thank you!","Rodrigo Caroca<br>Cuenca, Ecuador<br><br>Hi, I am Rodrigo Caroca, researcher at the University of Azuay in<br>Ecuador. I heard about freegenes from a colleague with whom I usually<br>collaborate in Genetic engineering related projects. I am currently<br>working on the identification, cloning and expression of genes coding<br>for catalytic activities (enzymes). Having a set of plasmids and an<br>Expression Tool kit will be of tremendous help to carry out my<br>research.   I would be sincerely thankful if you share this material<br>with me.","Kyle Mohler<br>West haven, United states<br><br>I came across Freegenes by accident while looking for recoded gene<br>sets. I work at Yale University in a synthetic biology lab that works<br>recoded organisms and orthogonal translation systems. We routinely<br>express recombinant protein and these gene collections will greatly<br>enhance our efficiency.","Dr. David J.  Castillo <br>Mexico city , Mexico<br><br>Hello, this is not my first order, the last times (I've tried 3 times)<br>the Mexican customs, retained and destroyed the samples. My<br>Suggestion: Please DO NOT LABEL THE PACKAGE CONTAINING NON PATHOGENIC<br>BACTERIA not DO NOT SEND THEM IN DRY ICE... if possible please, please<br>them at RT. Thank you","Jordan Strasser<br>Calabasas, United states<br><br>I intend to wear this shirt all the time","Matou\u0161 Kr\u00f6mer<br>Praha 6, Czech republic<br><br>Hi, I am Matou\u0161 and work as PhD student at Institute of Organic<br>Chemistry and Biochemistry in Prague, Czech republic. Our research is<br>focused on development of novel technologies for diagnostics and<br>biosensing with the use of modified nucleic acids. We would like to<br>use the genes for DNA-manipulating enzymes for preparations of<br>modified DNA.","Rafael nunes blanes<br>Portland, United states<br><br>I'm a biohacker. I want to use it as decoration for my living room and<br>make bio inspired interior design","Alec Lourenco<br>Los angeles, United states<br><br>Alec - Endy lab alumnus","George Burslem<br>Philadelphia, United states<br><br>I'm an assistant professor in Biochemistry and Biophysics at the<br>University of Pennsylvania and I heard about this initiative from New<br>PI Slack. These items will be used to support our research into the<br>roles of acetylation and ubiquitination in the regulation of protein<br>stability.","Eric Theis<br>Mount pleasant, United states<br><br>My Name is Eric, and I'm an independent botanist and plant geneticist<br>working out of my home research facility, currently studying the<br>possibility of natural ambient light sources","chiara gandini<br>Cambridge, United kingdom<br><br>I would use these DNA parts to produce enzymes and develop low-cost<br>protocols for enzyme production","Reuben Brown<br>Uq, Australia<br><br>I have ordered before, but am interested in some updtated enzymes and<br>the expression toolkit. Also the glowing plant kit would be amazing<br>for pracs! Reuben (Peer Schenk Lab)","Amjed Alsultan<br>Al Diwaniyah, Iraq<br><br>this items will help me in my research","Patompon Wongtrakoongate<br>Thonburi, Thailand<br><br>Dear FreeGenes    My name is Patompon Wongtrakoongate. I am an<br>assistant professor in at Department of Biochemistry, Faculty of<br>Science, Mahidol University, Bangkok, Thailand. My research area<br>focuses on non-coding RNA and epigenetics. However, last year we began<br>to work on COVID-19 vaccine and drug discovery due to the outbreak.<br>Having your collection will be a critical for us to continue working<br>vaccines and drug development.    I heard about the FreeGene project<br>from my colleague who already received some collection from you.<br>However, those collection does not cover COVID-19 related materials.<br>Therefore, I am writing this message to kindly ask you for the<br>COVID-19 collection as I have put them in my \u201cbasket.    Best regards<br>and looking forward to hearing from you,    Pat","Matthew  Parramore<br>Tallahassee, United states<br><br>Heard about from working with research group New York Botanics.<br>Institution: Florida State University Purpose: Extracurricular biotech<br>skill development complements my major in Biochemistry.","Hayden Norris<br>Grand blanc, United states<br><br>My name is Hayden Norris. I'm a grad student at the University of<br>michigan-flint I've been an active member/club officer of the<br>University of michigan-flint molecular biology club. I intend to use<br>this product as a demonstration tool to help students gain experience<br>with plant cell transfection. All of the students in the molecular<br>program at my University leave with experience with mammailian cell<br>culture/transfection. Very few of them have experience with plant lab<br>techniques. Our club is trying to give those students the opportunity<br>to learn plant lab techniques they wouldn't otherwise get. This<br>product would help out our club because the biggest expense in these<br>projects is usually the DNA. I heard about free genes through a<br>facebook group that is about plant molecular lab techniques/science.","Jes\u00fas Gonz\u00e1lez<br>Guadalajara, Mexico<br><br>I learned about Free genes from a friend (Andreas St\u00fcrmer) I study at<br>ITESO university in Mexico and I am part of an independent research<br>group \u201cPetalsmiths\u201d","Sarah Ware<br>West chicago, United states<br><br>I am already familiar with Freegenes :)","Tengo Gzirishvili<br>Tbilisi, Georgia<br><br>i'm from  Petalsmiths Research Group, i heard abt it from fb group, i<br>intend to use it in order to fulfill my knowledge abt plant<br>engineering","venu kamarthapu<br>Memphis, United states<br><br>Hi, This is Venu Kamarthapu, Staff Scientist, Structural Biology<br>Department, Stjude Children's Research Hospital, Memphis, TN. I<br>planning to use them to make my own enzymes ication for lab use.   I intend to use<br>these items for educational and research purposes. The enzymes<br>produced will be used for pc, restriction digestion, and ligation.","Isabella Messuti<br>Campinas, Brazil<br><br>My name is Isabella, I am entering (if everything goes well) in<br>biological physics graduation. I am building a qPCR machine together<br>with my boyfriend to sell at a low cost in the future. I am very<br>interested in genetic engineering and molecular biology, and these<br>items I requested are essential for the realization of my projects.<br>The reagents here at Brazil are very expensive, and many things end up<br>inaccessible to those who are starting with a small laboratory.","Keoni Gandall<br>Huntington beach, United states<br><br>I need to do some high throughput DNA cloning. pOpen_v3 rocks for that","Frank Beissel<br>Lakeville, United states<br><br>Research use to optimize indoor growth conditions.","Ryan George<br>Orlando, United states<br><br>Heard about from the petalsmiths research group. I plan on doing<br>research on plants and fungi, studying secondary metabolite pathways<br>and synthetic circuits.","Nico Bouchard<br>Rotterdam, Netherlands<br><br>Hi! I\u2019m a researcher with a background in plant bio now studying and<br>consulting in architecture and product design with focuses on<br>biodegradability, modularity, regeneration and metabolism.","Thewhan Fernando<br>Skegness, United kingdom<br><br>This is my first order, I heard anojt you guys from the petalsmiths fb<br>group","Andreas Stuermer<br>Kremsm\u00fcnster, Austria<br><br>I am working in the Ars electronica museum and want to try this out<br>for educational purposes","Sebastian Cocioba<br>Queens, United states<br><br>I am an independent researcher from Binomica Labs, am an experienced<br>plant bioengineer focused on developing educational tools for the<br>purpose of increasing scientific literacy and biotech competence,<br>especially around amateur biology circles.","Daniela ategies for the optimization of<br>the production of recombinant antigens for their application in the<br>development of diagnostic tests in veterinary medicine and for the<br>molecular monitoring the possible infection of SARS-CoV-2 in pets.<br>Thank you for this valuable initiative.","Ediner Fuentes<br>Ciudad de panama, Panama<br><br>I coordinate a network of Emerging Biotechnology Innovation<br>Laboratories in Latin America called The Bridge Biofoundry with<br>offices in Guatemala City, San Jos\u00e9 and Panama City. Our innovation<br>spaces are being occupied by innovators, scientists and entrepreneurs<br>in biosciences. One of the flagship projects is focused on providing<br>the region with vital proteins in molecular diagnosis, so having this<br>would reduce development times. This service is low cost, but it must<br>cover your expenses, especially in regions like ours where there are<br>high costs. My lines of research are focused on genomic editing for<br>species conservation, synthetic biology in the production of<br>therapeutic proteins and new molecular detection systems for endemic<br>and emerging viruses of the Central American tropics. Having this kit<br>would help us expand our response capabilities and accelerate our<br>contribution to regional health systems.","Khalid Alam<br>Chicago, United states<br><br>This is my second order. Unfortunately my collaborators at Argonne<br>National Laboratory cannot find where my previous plates are stored<br>(-80\u00b0C failures meant things got shuffled around and are not nowhere<br>to be found).     We intend to use these items to help us perform work<br>funded by the NSF and NIH through SBIR grants awarded to Stemloop,<br>Inc.","Franklin Nobrega<br>Southampton, United kingdom<br><br>Through colleagues","Muhammad Hassan  Raza<br>Islamabad, Pakistan<br><br>I have previously ordered the open enzymes collection which was<br>delivered to me but at the moment, ordering expression vectors for<br>Golden Gate assembly is not feasible due to the cost associated with<br>the process.     The enzymes from CoVID-19 diagnostic enzyme toolkit<br>will be used for the CoVID-19 diagnostic assays that our lab is<br>currently developing (earlier publication<br>https://pubs.rsc.org/en/content/articlehtml/2018/ay/c8ay00802g) as<br>well as other projects.     I also tend to establish the Golden Gate<br>assembly protocols in our lab and if there is a possibility of sharing<br>a ready to use expression vector, I would be much obliged. I have also<br>sent an email with details at freegenes AT standford.edu.     Best,<br>Hassan   Manufacturing Design Lead  Scienovative, PK","Blacki Migliozzi<br>Brooklyn, United states<br><br>I was a longtime member at Genspace and a founding member at Biotech<br>Without Borders. More recently I was a co-founder at a fee for service<br>research lab called Brooklyn Bio.","Shivang Joshi<br>Abu dhabi, United arab emirates<br><br>I heard about this through Twitter, I am a research scientist at the<br>New York University Abu Dhabi campus working in the field of synthetic<br>biology, these tools would be instrumental to use as proof of concept<br>tools and for development of pipeline to engineer novel biosensors and<br>therapeutics fast","Chayasith Uttamapinant<br>Rayong, Thailand<br><br>I am a lecturer at Vidyasirimedhi Institute of Science and Technology<br>(VISTEC) in Thailand, and recently got in touch with Dr Jenny Molloy<br>at University of Cambridge and learned of this initiative. We are a<br>synthetic biology lab in Thailand and many of these molecular biology<br>tools you provide are incredible useful for both teaching and<br>research. We develop molecular diagnostic technologies as well as<br>applying chemical and synthetic biology tools (particularly genetic<br>code expansion) to different applications in bioindustry and<br>healthcare.","Jacob Gershon <br>Binghamton, United states<br><br>I saw this on twitter, I am currently a grad student at Binghamton<br>University, and I am excited to play around with this kit!","Baskar Bakthavachalu<br>Bangalore, India<br><br>Hi, I am Baskar Bakthavachalu from inStem, Bangalore. You can read<br>more about me here: https://www.instem.res.in/tigs-ci/baskar-<br>bakthavachalu. We work on molecular neuroscience as well as<br>Flaviviruses. These tools we receive from you will be used for<br>molecular cloning and Dengue viral diagnosis from field mosquito<br>samples.","Connor Lewis<br>South hero, United states<br><br>Found you by searching google with terms like \"open source<br>biotechnology\" or \"open source plasmids\" ect. I'm currently a grad<br>student at the University of Vermont. Thinking about starting a<br>business that would utilize biotech but that's probably a few years<br>down the line so just the shirt will do for now haha","Horatio Everett<br>Dereham, United kingdom<br><br>Online","TING-WEI LIN<br>Taoyuan city, Taiwan<br><br>I'm in the residency of laboratory medicine at Linkou Chung Gung<br>Memorial Hospital(Taiwan) and also be intrigued by molecular biology.<br>Sebastian S. Cocioba told me about this amazing organization. And I<br>also deeply believed in a more cooperative and transparent science for<br>every.","Harm van der Veer<br>Eindhoven, Netherlands<br><br>I am a Biomedical Engineering master student from the Eindhoven<br>University of Technology currently trying to develop a nucleic acid<br>diagnostic test as part of my graduation project. I was looking for<br>negative and positive control plasmids for SARS-COV-2 detection and<br>found your great freegenes project. Our research group in Protein<br>Engineering is also currently working on novel SARS-COV-2 diagnostic<br>tests. These two sets of plasmids you provide will certainly boost our<br>research to hopefully help fight this and future pandemics.","Mikhail Khvochtchev<br>Bangkok, Thailand<br><br>I am a faculty member at the Department of Biochemistry, Mahidol<br>University in Bangkok, Thailand<br>https://biochemist -studies-low-cost-and-open-tools-science    Regards,  Greg<br>Paynter","Cecilia D'Alessio<br>Ciudad aut\u00f3noma de buenos aires, Argentina<br><br>Dear Sirs: we received your first versi\u00f3n of the covid19 toolkit<br>several month ago and we are distributing it among Argeninian<br>researchers. We would really appretiate if you could send the newly<br>released kits added in the cart.  Thank you very much for all your<br>efforts.","Dagnew Bitew<br>Gondar, Ethiopia<br><br>I'm a PhD student at Institute of Biotechnology, University of Gondar,<br>Gondar, Ethiopia. I'm working on isolation, screening, identification<br>and improvement of yeasts for brewery industry application. I have<br>been searching agencies for reagent support. And colleagues has told<br>me your organization.","Patricia Pellicena<br>Redwood city, United states<br><br>I am a biotechnology professional. On the side, I put together<br>learning exercises for high school students.","Christopher Lohans<br>Kingston, Canada<br><br>I'm currently starting up my new lab at Queen's University in Canada,<br>and the resources in these collections will be invaluable for getting<br>some of our research under way. I heard about this website through the<br>New PI slack.","Tal Globus<br>Santa clara, United states<br><br>I\u2019m Tal Globus, a member of BioCurious in Santa Clara, California and<br>of the Real Vegan Cheese project. I\u2019m working on learning and teaching<br>the field, and hopefully creating something of use to someone, too!","Sobeida Sanchez-Nieto<br>Ciudad de m\u00e9xico, Mexico<br><br>I am Dr. Sobeida Sanchez, I work with plant cell carbon partition and<br>I am the Head of the Biochemistry Department, I am thinking in using<br>the material to stablish protocols for the undergraduate biochemistry<br>laboratory","James Jacoby<br>Victoria, Canada<br><br>I run the lab at the Victoria Makerspace, in Canada. Please feel free<br>to wait on shipping until the Molecular Diagnostics toolkit is<br>available o<br>expression would also be very cool. Any and everything the Jewett lab<br>has put out about glycosylation or their bio-bits papers would be<br>awesome to play with and have easy access to.","Travis Wertz<br>Boise, United states<br><br>I'm from Boise State University, finishing my PhD in Biomolecular<br>Sciences. I heard about you through Bionet. I plan on using the<br>enzymes and reporters to clone into some of our mammalian plasmids<br>that we use to study the blood brain barrier.","Moritz Woermann<br>Muenster, Germany<br><br>I saw this on the internet at a blog of a friend of mine and just want<br>to play around in school (In Germany we have these Bio research<br>groups, which take place in school and are taken voluntarily)","Gvidas Katauskas<br>Kretinga, Lithuania<br><br>I am Gvidas, 4th year undergraduate biochemistry student at Vilnius<br>University.    I've heard about Free genes on google discussion board<br>on got to get gene/plasmid without ordering gene fragment or buying<br>from addgene because I have no budget for it.    Intended use: to fuse<br>fluorescent protein gene (start with Rfp in liz-Rfp, then try others)<br>with my protein of interest, clone into yeast protein expression<br>vector and check, using fluorescent microscopy, whether mutated and<br>wild type proteins still form dimers.","Alfonsina Milito<br>Cerdanyola, Spain<br><br>I am a PostDoc Researcher at the centre for research in agricultural<br>genomics in Barcelona, and I will study essential genes in E.Coli and<br>yeast. I heared about freegenes from my collegues.","Alfonsina Milito<br>Cerdanyola, Spain<br><br>I am a postdoc researcher at the centre for research in agricultural<br>genomics in Barcelona and I will study essential genes and express<br>them in E.coli and yeast. I heared about freegenes from my collegues.","Muhammad Hassan  Raza<br>Islamabad, Pakistan<br><br>My name is Muhammad Hassan Raza and I am leading a biotechnology<br>startup Scienovative in Pakistan as a co-founder and manufacturing<br>design lead.     I heard about Freegenes project back in 2017 during<br>my participation in iGEM when I was representing iGEM Peshawar at the<br>Giant Jamboree in Boston. Afterward, I was part of the Global<br>Community Biotechnology Fellowship program organized by the Community<br>Biotechnology group at MIT where I heard a lot about freegenes both<br>from colleagues as well as Harry Akligoh himself. I also attended a<br>session by the Open Bioeconomy Lab at Bio Summit.     Currently, our<br>team is aiming to utilize the open enzymes collection for different<br>community biotechnology projects that we are developing; but due to<br>lack of funding and inaccessibility to resources, the wet lab part of<br>our projects is not being supplemented with the reagents. The enzymes<br>(primarily DNA polymerase and restriction enzymes including EcoRI and<br>XbaI) will be produced for consumption in our associated community<br>teaching laboratory.","Nico Crudele<br>Victoria, Canada<br><br>I heard about FreeGenes through the OpenCovid initiative. I'm trying<br>to engineer brewer's yeast using CRISPR to overproduce these enzymes<br>so they can be extracted from brewery waste and used for diagnostic<br>procedures!","Jeremy Wang<br>Chapel hill, United states<br><br>Jeremy Wang, Assistant Professor of Genetics, UNC Chapel Hill. We\u2019re<br>working on scaling up LAMP testing and mainly need to both reduce<br>enzyme costs (Bst) and produce a lot of encapsulated positive controls<br>to use as process controls.","George Lu<br>Houston, United states<br><br>George Lu, Rice University, for research only","Vish Raja<br>Chennai, India<br><br>Techbio solutions, for research use only","Hannah Benisty<br>Barcelona, Spain<br><br>use them to increase gene expression in E.coli and have a reporter<br>system in mammalian system","Adrian Filip<br>Ottawa, Canada<br><br>Ottawa Bioscience","Ravi Kumar<br>New delhi, India<br><br>I am Ravi Kumar pursuing my PhD in Biotechnology from ious basic molecular biology techniques such as<br>cloning and expression in E. coli and S. cerevisiae.   The Reporter<br>genes are to be used for educational as well as research purposes,<br>mainly to demonstrate protein expression in E. coli and yeast,<br>intracellular, extracellular and surface display. The Open enzyme<br>genes will be used to try to produce recombinant enzymes that can be<br>used for educational purposes. This will be collaborated with a<br>company called phusabiochem (https://www.phusabiochem.com/vi/.html) to<br>help distribute these to high schools and colleges across Vietnam.","Bruce Nash<br>Cold spring harbor, United states<br><br>Bruce Nash, Assistant Director for Science, Cold Spring Harbor<br>Laboratory DNA Learning Center. I am developing supply chain models<br>for biotechnology programs as part of InnovATEBIO, the National Center<br>for Biotechnology Education. We plan to have biotech students learn<br>skills while also supporting authentic research efforts by HS, CC, and<br>university students and Citizen Scientists - providing needed access<br>to science and biotech practice while democratizing these efforts to<br>broaden who can learn biotech and do science.","Scott Pownall, PhD<br>Vancouver, Canada<br><br>Hanna, please email me the FedEx tracking number when ready so I can<br>deal with any boarder issues.","Carlo Carolis<br>Barcelona, Spain<br><br>Hi ,  My name is Carlo Carolis and I'm the Head of Bimolecular<br>Screening and Protein Technologies Unit at the Centre for Genomic<br>Regulation in Barcelona (Sapin). The CRG is an international<br>biomedical research institute of excellence whose mission is to<br>discover and advance knowledge for the benefit of society, public<br>health and economic prosperity.    Goals    1.To be a world leading<br>centre in biomedical science, by providing our scientists with a<br>stimulating environment, cutting edge technologies and the freedom to<br>conduct the most innovative research.  2. To communicate and establish<br>a bi-lateral dialogue with society, by engaging the public and taking<br>into account their demands and needs.  3. To provide multi- and inter-<br>disciplinary training for the next generation of scientists as well as<br>supporting science education.  4. To translate new scientific<br>knowledge into benefits for health and value for society.  My Unit as<br>part of the core facility dept of CRG, our goal is providing vector<br>reconstruction and protein purification and characterisation service<br>for internal institute researchers. We would like to use these<br>proteins for help the researcher in reducing the total cost for their<br>experiments and improving their technology development. We will use<br>exclusively for internal academic users.    Best regards,  Carlo","Jae-Seong Yang<br>Cerdanyola del vall\u00e8s, Spain<br><br>Hi, I am a junior group leader in CRAG (Center for Agricultural<br>Genomics) in Spain. I would like to use these genes to study the<br>interactions of COVID proteins.","Renata Fernandes<br>S\u00e3o paulo, Brazil<br><br>My name is Renata Bannitz. I am pos doctoral at the University of Sao<br>Paulo. We develop two projects. One is about the development of a new<br>generation biopharmaceutical to treat leukemia. The other project is<br>related to the diagnostic of COVID in patient and environmental<br>samples.   Thank you for the initiative!!!","Thi Huyen Nguyen<br>Hanoi, Vietnam<br><br>Dear Hannah Verdonk  I am Ngo Tat Trung, PhD, an Principal<br>Investigator at Dept of Molecular Biology,  and the director of Centre<br>for Genetics Counsulation and Cancer Screening (CGC) of 108 military<br>Hospital, Hanoi, Vietnam ( non-commercial institution)  We are keen on<br>developing molecular diagnostics test for, blood sepsis microbial<br>pathogens, acquired antibiotics resistance gene, and currently our<br>community assigned us to provide molecular diagnostics test for the<br>surveillance of SARS-CoV-2 (in a charity format)  Actu  CC, and<br>university students and Citizen Scientists - providing needed access<br>to science and biotech practice while democratizing these efforts to<br>broaden who can learn biotech and do science.","Antonio J. Vallecillo<br>Cuenca, Ecuador<br><br>Dear Freegenes members. Antonio J. Vallecillo, professor from the<br>Facultad de Ciencias Agropecuarias de la Universidad de Cuenca,<br>Ecuador, writes to you; the Universidad de Cuenca is a public<br>university located in southern Ecuador. We have recently started with<br>the implementation of a molecular biology laboratory, however we have<br>difficulties accessing biological material and the high costs prevent<br>us from being able to acquire them. All the material that I am<br>requesting will be used for the development of research in molecular<br>biology in southern Ecuador. It will be very helpful for us to produce<br>these inputs without commercial purposes, since our economic<br>conditions limit our access to these reagents necessary for research<br>and teaching. For any additional information request, you can write to<br>me at: antonio.vallecillo@ucuenca.edu Thanks for your reply, best<br>regards. Antonio J. Vallecillo","Daniel Zeigler<br>Columbus, United states<br><br>For BGSC","Minnie Li<br>Piscataway, United states<br><br>It's for genscript","Bruce Nash<br>Cold spring harbor, United states<br><br>Bruce Nash, Assistant Director for Science, Cold Spring Harbor<br>Laboratory DNA Learning Center. I am developing supply chain models<br>for biotechnology programs as part of InnovATEBIO, the National Center<br>for Biotechnology Education. We plan to have biotech students learn<br>skills while also supporting authentic research efforts by HS, CC, and<br>university students and Citizen Scientists - providing needed access<br>to science and biotech practice while democratizing these efforts to<br>broaden who can learn biotech and do science.","Antonio J. Vallecillo<br>Cuenca, Ecuador<br><br>Dear Freegenes members.  A lar diagnosis kit for this disease. Thus, I<br>would like to know if you can provide the requested plasmids so we can<br>start ASAP to develop our tests. Additionally, I am asking for other<br>molecular biology plasmids that would provide me great opportunities<br>to increase the national biotech scenario in Brazil with my company.<br>Thank you very much for your tremendous contribution. To the world.<br>Any kind of help is of great appreciation.","Alec Lourenco<br>La ca\u00f1ada flintridge, United states<br><br>After talking with Keoni, I plan on purifying Taq polymerase as a<br>proof of concept for a heat-purification scheme.","Sebastien Rodrigue<br>Sherbrooke, Canada<br><br>Hello,  My name is S\u00e9bastien Rodrigue and I am a principal<br>investigator at the Universit\u00e9 de Sherbrooke, Canada. I plan to use<br>the genes from these collections to create various constructs and to<br>express common molecular biology enzymes.","R\u00fcdiger Trojok<br>M\u00fcnchen, Germany<br><br>Hey there, my name is R\u00fcdiger Trojok, biohacker and twice ex-iGEM...<br>now running my own molecular bio lab Bio.kitchen in Munich www.utum-<br>bio-kitchen.de. Further noteworthy info: consulted the German<br>Parliament on Synthetic Biology in 2015, wrote a popular science book<br>on biohacking and started a startup on microfluidics lab automation<br>technology. check out my homepage www.trojok.bio for more info. Best,<br>R\u00fcdiger Trojok PS: im happy so share back any parts im going to<br>develop.","Sebastien Rodrigue<br>Sherbrooke, Canada<br><br>Hello,   My name is S\u00e9bastien Rodrigue and I am a principal<br>investigator at the Universit\u00e9 de Sherbrooke, Canada. I plan to use<br>the genes from these collections to create various constructs and to<br>express common molecular biology enzymes.","Sebastien Rodrigue<br>Sherbrooke, Canada<br><br>Hello,  My name is Sebastien Rodrigue and my lab works on Mesoplasma<br>forum. My group has developed whole-genome cloning and transplantation<br>along with comparative genomics and systems biology for this organism.<br>My team intends to study protein-protein interaction with the ORF<br>library.","robson  tramontina<br>Campinas, Brazil<br><br>Dear stanford.freegenes.org staff,    My Name is Robson Tramontina, I<br>am a phD student at the University of Campinas \u2013 Brazil and I own a<br>start-up called ECRA Biotech.  Given the situations about COVID19 here<br>in brazil, the high dollar value and the lack of enough tools for<br>COVD19 diagnosis, I am reuniting Brazilian researchers to develop a<br>public national molecular diagnosis kit for this disease. Thus, I<br>would like to know if you can provide the requested plasmids so we can<br>start ASAP to develop our tests. Additionally, I am asking for other<br>molecular biology plasmids that would provide me great opportunities<br>to increase the national biotech scenario in Brazil with my company.<br>Thank you very much for your tremendous contribution. To the world.<br>Any kind of help is of great appreciation.","Thiago Negr\u00e3o Chuba 02/05-11/05)<br>Kyoto, Japan<br><br>I'm a Brazilian Master's Student at Kyoto University, Japan. Although<br>my field is nanotoxicology, I've become more interested in SynBio and<br>I'd like to start some hands-on experiments in my lab. Also, I'm<br>planning to start an iGEM team for next year's competition, and such<br>tools will be very useful in several future applications.","R\u00fcdiger Trojok<br>M\u00fcnchen, Germany<br><br>hey, i introduced myself in my first order. Best, R\u00fcdiger","R\u00fcdiger Trojok C/O Bettina Richter<br>Garching, Germany<br><br>Hey there, my name is R\u00fcdiger Trojok, biohacker and twice ex-iGEM...<br>now running my own molecular bio lab Bio.kitchen in Munich www.utum-<br>bio-kitchen.de. Further noteworthy info: consulted the German<br>Parliament on Synthetic Biology in 2015, wrote a popular science book<br>on biohacking and started a startup on microfluidics lab automation<br>technology. check out my homepage www.trojok.bio for more info. Best,<br>R\u00fcdiger Trojok  PS: im happy so share back any parts im going to<br>develop.","Thiago Negr\u00e3o Chuba 02/05-11/05)<br>Kyoto, Japan<br><br>I'm a Brazilian Master's Student at Kyoto University, Japan. Although<br>my field is nanotoxicology, I've become more interested in SynBio and<br>I'd like to start some hands-on experiments in my lab. Also, I'm<br>planning to start an iGEM team for next year's competition, and such<br>tools will be very useful in several future applications.","Ricardo Camilo Chavez Martinez<br>Brownsville, United states<br><br>Scintia is a Mexican startup working on facilitating the way we teach<br>do research and innovate in emerging economies, like the Latin America<br>region.","Gyorgy Babnigg<br>Lemont, United states<br><br>This is Gyorgy Babnigg @ ANL interested in COVID-19 diagnostics and<br>expression of viral and human host proteins. Clones of commonly used<br>molecular biology enzymes would enable scaling up some of the cloning<br>efforts. I use reporters in bio manufacturing research.","Guy Aidelberg<br>Paris, France<br><br>I'm finishing a PhD on democratizing DNA detection, mostly using LAMP,<br>see gmodetective.com, at the CRI in Paris where at least some of the<br>iGem board sits. we would be happy to spread them in France/Europe and<br>beyond! Andrew and Ariel have already been discussing for a while,<br>Please send extras so we can help spread! Also please send what you<br>can ASAP, and whatever is not available yet at a later date..","Gyorgy Babnigg<br>Lemont, United states<br><br>This is Gyorgy Babnigg @ ANL interested in COVID-19 diagnostics and<br>expression of viral and human host proteins. Clones of commonly used<br>molecular biology enzymes would enable scaling up some of the cloning<br>efforts. I use reporters in bio manufacturing research.","Scott Pownall<br>Burnaby, Canada<br><br>for FedEx shipping during covid-19 please use this address: Dr. Scott<br>Pownall FedEx Ship Centre 4270 Dawson St Burnaby, BC  V5C 4B1 Canada<br>My Cell: +1(778)891-7133 Email: scott@opensciencenet.org","Sarah Khan<br>Peshawar, Pakistan<br><br>","Ricardo Camilo Chavez Martinez<br>Brownsville, United states<br><br>Scintia is a Mexican startup working on facilitating the way we teach<br>do research and innovate in emerging economies, like the Latin America<br>region.","Celeste Wale<br>Crawley, Australia<br><br>I'm a structural biologist at the University of Western Australia,<br>potentially being requested to produce diagnostic enzymes for the<br>state govt.","Felipe Campos<br>Campinas, Brazil<br><br>Hi Keoni!    I really appreciate the work you're doing in making a<br>repository and automating essential genes for biotechnology!    I am<br>currently working on a fast and low cost qPCR Open machine. I am very<br>interested in the Covid-19 detection kit for testing and calibration.<br>I am also interested in enzymatic synthesis of DNA through TdT<br>Polymerase.  At the moment I am not affiliated with any organization,<br>although I studied Physics and Chemistry at the University of Campinas<br>(Unicamp) here in Brazil. I have access to a controlled environment<br>and will follow good laboratory and disposal practices.    Thanks in<br>advance!","Addgene None<br>None, United states<br><br>","Daniel Uribe<br>Brownsville, United states<br><br>","Adrian Filip<br>Ottawa, Canada<br><br>Ottawa Bio Science","Emin Bursa<br>The allen, United states<br><br>I am running a small research lab aiming to learn about genetics in<br>the context of synthetic biology and help develop toolsets for<br>engineers and scientists. It would be amazing and very beneficial to<br>get some of these molecules, thanks.    Emin Bursa  Mynqa LLC","Peer  Schenk<br>Saint lucia, Australia<br><br>","Chris Monaco<br>Atlanta, United states<br><br>","Michael Valipour<br>West chicago, United states<br><br>I lead one of two Covid teams at BioBlaze Chicago under the<br>supervision of Dr. Sarah Ware.  We are participating in half a dozen<br>projects with too many people and institutions to list.","Cecilia D'Alessio<br>Ciudad autonoma de buenos aires, Argentina<br><br>My name is Cecilia D'Alessio and I am a Biotechnology professor at the<br>School of Sciences, University of Buenos Aires. Our country is<br>currently importing supplies to face the global Covid-19 pandemic. The<br>number of tests already acquired not only will last a short time if<br>the disease enters the logarithmic stage, but also the economic<br>difficulties in Argentina, together with the restriction of certain<br>companies to provide only their own country with tests will make it<br>difficult to obtain them in the near future. We are currently running<br>a facility at our University, to produce proteins of high interest<br>that are very expensive to afford with local grants in order to<br>provide molecular biology research laboratories. Now, we plan to use<br>our facility to sinthesize the proteins required to diagnose. Your<br>help to support the local production at research institutes of openly<br>shared SARS-CoV-2 diagnosis reagents and research molecular biology<br>enzymes would make a real difference. The way we aquire supplies and<br>donations is through a Foundation (Fundacen), which help us with<br>customs paperwork and reduced taxes. We thank you very much in advance<br>if you could provide us with Covid19 tool kit and OpenEnzymes_1 set.","Shyam Saladi<br>Pasadena, United states<br><br>Requested openEnzyme_1 and specific M, N, and E protein constructs via<br>email (copied here).      ASAP would be awesome (We'd get started as<br>soon as they arrive):        M, E. coli -          4136462<br>4136550          4136605        M, Yeast -          4046428<br>4046268          4046467          4046216          4046181<br>4046470          4046292          4046253          4046240<br>4046310          4046229          4046225          4046457<br>4046489          4046381          4046277        Later is okay:<br>M, E. coli -          4136454          4136457        N, E. coli -<br>4136408          4136429          4136430          4136431<br>4136770        E, E. coli -          4136771          4136558<br>4136453          4136460          4136463        E, Yeast -<br>4046262          4046431          4046382          4046455<br>4046380          4046476          4046335          4046561<br>4046346          4046193          4046493          4046566<br>4046444          4046261          4046275          4046503<br>COVID-19 Diagnostic Toolkit would be great--although there is no rush<br>on this.    Thanks Keoni and Hannah for all your help! Clemons Lab<br>really appreciates it!","Madhavi Hewadikaram<br>Homagama , Sri lanka<br><br>Im a molecular biologist at SLINTEC Academy , Sri Lanka","Vesta Korniakova<br>Montreal, Canada<br><br>I'm Vesta Korniakova, a member of BricoBio and Foulab, 2 community<br>labs in Montreal, as well as a student INRS-Institut Armand Frappier.<br>I am also an active member of the Ronin Institute. Since the pandemic,<br>I have been setting up a home lab and know of others in Montreal that<br>are working from home as well in an attempt to continue their<br>research.","Ricardo Chavez<br>Palo alto, United states<br><br>We simplify the way we teach, do research and innovate in synthetic<br>biology in emerging economies. We are Scintia","Ricardo Chavez<br>Monterrey, Mexico<br><br>We simplify the way we teach, do research and innovate in synthetic<br>biology in emerging economies. We are Scintia.","Viktor Antonio Mackenzie-Lamb<br>Basel, Switzerland<br><br>Hello. We are a group of DIYBiologists in Basel who work out of the<br>Starship Factory makerspace in Basel. We have recently built a lab<br>here and would love to see what we can do with these enzymes. Thank<br>you :)","Guy Aidelberg<br>Paris, France<br><br>I'm finishing a PhD on democratizing DNA detection, mostly using LAMP,<br>see gmodetective.com, at the CRI in Paris [0.625,"rgb(66,146,198)"],[0.75,"rgb(33,113,181)"],[0.875,"rgb(8,81,156)"],[1.0,"rgb(8,48,107)"]],"line":{"color":"rgba(102, 102, 102)","width":1},"opacity":0.7,"size":10,"symbol":"square"},"mode":"markers","text":["Christopher Kinyanjui Kariuki<br>Leuven, Belgium<br><br>The materials will be used for training and research purposes with our<br>colleagues in East Africa, in particular Kenya, Tanzania and Ethiopia.<br>We are therefore very thankful for your kind offer","Jehovani Lopez<br>Brooklyn, United states<br><br>We are a community biolab in brooklyn.","Ivan Slovokhotov<br>Moscow, Russia<br><br>Currently, I'm building different cloning and expression vectors. If<br>you want, I can share them, when they'll be ready.","Mads Kaern<br>Ottawa, Canada<br><br>Very impressive initiative","Isaac Larkin<br>Evanston, United states<br><br>I solemnly swear my BIL will wear this responsibly.","Matthew Thompson<br>Manchester, United kingdom<br><br>-","Melanie Arbour<br>Montreal, Canada<br><br>Thanks a lot for these tools!","Shailendra Vyas<br>New delhi, India<br><br>We are a for profit company and are willing to use these products for<br>the community and making it available at a nominal profit that can<br>sustain our activities.","Dayananda  Chandrappa<br>Bengaluru, India<br><br>We are a deep tech startup based in Bengaluru  working on sustainable<br>and eco-friendly products for Healthcare and environmental industries","Elliott Graham<br>Wolverhampton, United kingdom<br><br>N/A","Miles Rogers<br>Cambridge, United states<br><br>You are a great resource!","Sarah Ware<br>West chicago, United states<br><br>Students were working on the transformations and it seems there has<br>been contamination.  Please re-send :)","\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0428\u0438\u043b\u043e\u0432\u0438\u0447<br>Moscow, Russia<br><br>I wanted to order a T-shirt also, but the website says that more than<br>5 items is forbidden, so I will order it separately","Emiliano Vilardo<br>Rosario, Argentina<br><br>Empty","Paulina Ejsmont<br>Paris, France<br><br>In case you would like to know more about our projects, please our<br>website: https://www.cri-paris.org/en/research","Fernan Federici<br>Macul, Chile<br><br>we love the FreeGenes project would be very happy to help in<br>redistribution within Chile if nedeed","Brody McNutt<br>Boulder, United states<br><br>I would be happy to share materials with others in the future, but I<br>am process of moving and don't know when I will be in a position to do<br>so","Jose Munoz<br>Newcastle upon tyne, United kingdom<br><br>I am interested to characterise new enzyme families and activities for<br>waste conversion into biofuels","Manish Kushwaha<br>Jouy-en-josas, France<br><br>Where possible, we prefer purified DNA rather than glycerol stocks.<br>Thank you!","Hiroyuki Ichida<br>Wako, Japan<br><br>Thank you very much for this fantastic set of genes. This is an<br>essential toolset for newcomers to the field like us.","Jennifer Molloy<br>Cambridge, United kingdom<br><br>Would prefer purified DNA","Zoila E Jurado Quiroga<br>Pasadena, United states<br><br>2nd time ordering, first time transformation did not all work. And kit<br>was incomplete (#28 missing) and given sequence was not accurate to<br>respective part (ex. #16) Thank you for everything.","Fristot Elsa<br>Montpellier, France<br><br>x","Hiroyuki Ichida<br>Wako, Japan<br><br>Great thanks to this fantastic collection!","Shu Li<br>Torrance, United states<br><br>NA","Norhan Hassan<br>Thuwal, Saudi arabia<br><br>Thank you","SERV0223789 CAROLINE  BACQUET <br>Miami, United states<br><br>I am Caroline Bacquet and I teach and do research at University Ikiam,<br>founded 8 years ago in the Ecuadorian Amazon area. Our budget and<br>installations are very limited, so I'm delighted to find these frees<br>resources. We are educating future biotechnology engineers with strong<br>social and environmental values. I'm very thankful for your incredible<br>work and generosity.","kangquan YIN<br>Beijing, China<br><br>currently not any.","Danielle Pedrolli<br>Araraquara, Brazil<br><br>The SynBio Lab at UNESP keeps a plasmid collection that is made<br>available for any Brazilian Lab free of charge upon request.","Fernando Bustos<br>\u00d1u\u00f1oa, Chile<br><br>We are a research and development company that sells kits for biotech<br>and STEM educational kits. We would like to start producing some<br>enzymes to lowers costs of production and make science available to<br>lower income educational establishemnts","Juan Alvarez<br>Calgary, Canada<br><br>I can also be reached through my LinkedIn:<br>https://www.linkedin.com/in/juan-sebastian-alvarez-3bb1b8157/ Was<br>watching the cGEM conference this weekend, and I learned about the<br>work that Friendzymes is doing! That is why I am ordering the<br>b.subtillis toolkit.","Ganesh Prasad<br>Bengaluru, India<br><br>We are start up based out of bangalore, India envisaging the<br>development of molecular biology products and reagents locally so that<br>we can bring down the cost of the reagents so that these become<br>affordable to researchers in india","Wei-Min Chang<br>Taipei, Taiwan<br><br>Thank you so much","Kristel Alman<br>Tartu, Estonia<br><br>The enzyme and reporter collections can be in either glycerol stocks<br>or purified DNA, no preference.","Mariela Escobar<br>Rosario, Argentina<br><br>We are building our molecular biology lab and these kits will be<br>extremely useful for us.","Maira Goytia<br>Atlanta, United states<br><br>Thank you for all your work!","Leandro Oliveira (NG)<br>Cambridge, United kingdom<br><br>I prefer a purified nucleic acids format if possible","Ahmad Suparmin<br>Sleman, Indonesia<br><br>We need all of those in the glycerol stocks form (E. coli glycerol<br>stocks ).","Michael Hudson<br>Harrisburg, United states<br><br>I am using Glowing Plant as a experiment for a demonstration speech<br>and the rest I am going to use this for a research paper.","Stijn Tobias de Vries<br>Marburg, Germany<br><br>If it's easier to send by mail, plasmids are also fine. We can perform<br>the relevant transformations here in high throughput.  Which strain<br>would you recommend for the protein expression of the Open Enzymes<br>kit? We generally use BL21(DE3 ) Codon + RIL for protein expression.<br>Thank you so much in advance!","Reuben Brown<br>Uq, Australia<br><br>You need a permit and a manufacturer's declaration, I have these and<br>will forward them to you. The manufacturer's declaration can be<br>submitted via email to fedex as it needs the tracking number and can<br>be annoying to do at the time of shipping. our fedex account number is<br>\u201c3017-0695-2\u201d feel free to use it.","Emilia Mazza<br>Rosario, Argentina<br><br>i love mushrooms!","Elliot Medina<br>Tampa, United states<br><br>n/a","Ingrid Jaramillo<br>Medellin, Colombia<br><br>I would like to collaborate in this open bioeconomy lab idea.","Maya Bendifallah<br>\u00c9vry-courcouronnes, France<br><br>nothing to add!","Maan Neamah<br>Kufa, Iraq<br><br>Thanks for these materials, it would provide an appreciated help for<br>our research.","Uriel Eleazar Barboza Perez<br>Irapuato, Mexico<br><br>Importing biological material to mexico is quite hard, owing to this I<br>think it might be easier to send the material as DNA rather than<br>glycerol stocks. So purified nucleic acid would be a better format.","Emilia Mazza<br>Rosario, Argentina<br><br>i am from argentina","Ravendran  Vasudevan<br>Cambridge, United kingdom<br><br>Thanks for your service","Bronagh Hogan<br>Thuwal, Saudi arabia<br><br>No other comments","Emiliano Emiliano<br>Rosario, Argentina<br><br>You are awesome and should have more about fungi and less about e coli","Fernando Guzman-Chavez<br>Cambridge, United kingdom<br><br>I hope that more collections can be included in the future.","Wei-Min Chang<br>Taipei, Taiwan<br><br>I just want to say thank you for whole group","Sergen Unal<br>Istanbul, Turkey<br><br>Thank you","Xavier Coadic<br>Rennes, France<br><br>You are an awesome initiative","Richard Jones<br>Lower lake , United states<br><br>Are the plasmids lyophilized?  We should be getting our Ultra low -80<br>freezer in the next month or two.","Ben Thuronyi<br>Williamstown, United states<br><br>Excited about this project!","Rodolfo Marcolino<br>La plata, Argentina<br><br>I find the project very interesting ! Got experience from the_Odin<br>Kits !!! All the Best   Rodolfo","Sergen Unal<br>Istanbul, Turkey<br><br>No Thanks","Esther Kim<br>Pleasanton, United states<br><br>Testing the parts for Scott Pownell.","Carlos  Breyer <br>S\u00e3o paulo, Brazil<br><br>Congratulations on the initiative, it makes research a lot easier","Justin Vaillancourt<br>Vancouver, Canada<br><br>.","Tim Dobbs<br>Paris, France<br><br>Please ship in E.coli if you have successfully shipped GMO cultures to<br>France or The EU previously. Otherwise, ship as DNA. I haven't been<br>able to find a definitive policy for importing GM microorganisms to<br>France, but from past experience I know that sometimes GM strains get<br>held up in customs. So if you are similarly unsure, it may be best to<br>ship as DNA to avoid problems at customs.  Please reach out if you<br>have any questions. Thanks!","Joey Riepsaame<br>Oxford, United kingdom<br><br>I'm a big fan of the BioBrick foundation and have contributed<br>sequences in the past. I'm still very excited about the mammalian<br>promoter library I submitted a while ago. Any chance this will go in<br>production soon?  Also, would it be useful to have a human<br>transcription factor library as described by George Church in the<br>paper below?  https://www.nature.com/articles/s41587-020-0742-6","Joel Graff<br>Butte, United states<br><br>I have a YouTube channel that I haven't done anything with for a<br>while.  I have been thinking about making videos of everyday lab work.<br>However, I have wondered how many people would be interested in<br>learning about my lab's specific research.  I'm interested in these<br>enzymes (and other resources from this organization) because I could<br>see my videos being beneficial to others that may use this collection.<br>Would it be OK to create videos for YouTube to explain how to use<br>these reagents?  (My YouTube channel is \"Life and Biology\" if you<br>would like to check it out.)  Thanks!  -Joel","Caua Westmann<br>Zurich, Switzerland<br><br>I may not use all kits in my own research but I would be extremely<br>happy to have them in the lab for next gen of researchers and also for<br>the local scientific community.","Jonathan Tellechea<br>Valencia, Spain<br><br>Nothing else really.","Han ming Gan<br>Rawang, Malaysia<br><br>THanks for your great work","Sarah Ware<br>West chicago, United states<br><br>NA","John Allan<br>Newcastle upon tyne, United kingdom<br><br>Goan yersel big man","Esteban Erben<br>San martin, Argentina<br><br>Having the chance to produce our own molecular biology reagents will<br>allow us to keep doing great science at low cost. Thanks for<br>contributing!  If possible use Fedex and U$D 1 as declared value. If<br>shipment declares commercial values I can not get it out of the<br>Argentinean custom. In general UPS requires a broker.   I prefer to<br>get the DNA, not glycerol.","Nicole Prandi<br>Cambridge, United kingdom<br><br>.","Ahmad Suparmin<br>Sleman, Indonesia<br><br>I'm a researcher at development country, I pursue more student to do<br>research in my country educate more student about molecular genetic","Renata Fernandes<br>S\u00e3o paulo, Brazil<br><br>nothing to comment","David Chiasson<br>Halifax, Canada<br><br>Thanks for offering this collection!","Gwyn Uttmark<br>Casper, United states<br><br>This is a test order to confirm \"closing the loop\" works.","Brady Baggett<br>Portland, United states<br><br>Purified Nucleic Acid form please. Thank you!","Kulvinder Gill<br>Pullman, United states<br><br>We intend to use the items in our molecular biology lab for research<br>purpose only.","Kyle Mohler<br>West haven, United states<br><br>N/A","Emin Bursa<br>Plano, United states<br><br>please don't require signature for delivery, thank you!","Simran Kushwaha<br>Pilani, India<br><br>Nothing","Jose David Rosales<br>Miranda, Venezuela<br><br>First of all, congratulate them for their support in providing these<br>biotechnological tools. Previously I got the open protein plate and I<br>managed to recover 50% of the clones, I hope they can send me the<br>plate again to recover the rest of the clones. Of the items of<br>Molecular Diagnostics Toolkit I prefer that you send plate # 2, which<br>contains plasmid DNA. Thanks again for your support.","Wilson Teran<br>Bogota, Colombia<br><br>Pandemia had tremendous negative impact on research and teaching<br>activities, in particular for molecular cloning activities as many<br>reagents, enzymes are imported. Importing procedures, for this kind of<br>reagents, usually took 1 month before COVID19, but now this time has<br>increased up to 3 months on average. This hampers any opportunity to<br>work in eitehr research or teaching projects related to molecular<br>cloning, molecular diagnosis, expression profiling, etc.. with young<br>undergraduate students who are amongst the most interested in learning<br>from all latest advances on molecular biology and sharing their<br>knowledge. We are interested in learning more about isothermal<br>ampification (LAMP or RPA) in order to apply these developments for<br>research and molecular diagnosis of crop's diseases, considering all<br>recent developments for low cost or quick testings such as those<br>employed for COVID-19","Ellen Jorgensen<br>South salem, United states<br><br>BSL1 facility","Scott Pownall<br>Vancouver, Canada<br><br>A reminder to Grace to streak three Genscript parts on a plate and<br>include in the shipment. The parts are BBF10K_000059 (Sc_pGAL1),<br>BBF10K_000171 (AB_Sc-pGAL1) and BBF10K_000463 (Sc2micron). The first<br>two had technical issues and were pulled from the current<br>distribution.","Charlie Gilbert<br>Norwich, United kingdom<br><br>Hi there, my name is Charlie Gilbert. I am a research scientist<br>working at Colorifix Ltd. We are a growing biotech/synbio company<br>based in Norwich, UK. We use synthetic biology to engineer microbes to<br>produce dyes for the textile and fashion industry and want to use our<br>approach to improve the environmental sustainability of the dyeing<br>process. The open yeast kit would be of great use to us in<br>establishing yeast synthetic biology tools and approaches.","Dongyan Niu<br>Calgary, Canada<br><br>N/a","Jimmy Gledson Hayden Linhares<br>Manaus, Brazil<br><br>I have requested that kit and it was sent in glycerol stock, but our<br>lab couldn't recover any bacteria - probably 'cause they spent too<br>much time on Brazilian transport facilities. We would appreciate if<br>you could send it as nucleic acid. Best regards.","Lorenzo Zolfanelli<br>Paris, France<br><br>I am doing research on adaptive immunity as part of my PhD. I am also<br>involved an free software and open science movements, and I am trying<br>to communicate and diffuse a free (as in \"speech\", not \"beer\") culture<br>and mindset inside and outside my lab.","Benjamin Chavez<br>Gatersleben, Germany<br><br>I am in Germany so it will probably be much easier if we receive<br>plasmids if possible rather than glycerol stocks.","Jimmy Linhares <br>Manaus, Brazil<br><br>.","Zhiyong Lei<br>Utrecht, Netherlands<br><br>n.a.","Ian Cubit<br>Hagerstown, United states<br><br>That's about it! I had a bad time trying to culture pBUILD, but<br>everything else has been beautiful. Thank you!","Jordan Gonzalez<br>Pittsburgh, United states<br><br>N/A.","Kefentse Arnold Tumedi<br>Gaborone , Botswana<br><br>Recombinat DNA technology laboratory Researcher at Botswana Institute<br>for Technology Research and Innovation","Phil Roche<br>Mont-royal, Canada<br><br>glad these are available for education and open research","Joshua Maurer<br>Watervliet, United states<br><br>N/A","Angelica Hernandez<br>Metepec, Mexico<br><br>-","Leandro Oliveira (NG)<br>Cambridge, United kingdom<br><br>I am a professor at the Universidade Federal de Vi\u00e7osa in Brazil. I am<br>now a visiting researcher at University of Cambridge. I plan to start<br>using the toolkits in Cambridge and take them to Brazil.","Zoila E Jurado Quiroga<br>Pasadena, United states<br><br>Nothing","Shree Ram Singh<br>Montgomery, United states<br><br>We will like to one day payback in some manner in whatever little we<br>can to Freegenes for their efforts for making biotechnology open to<br>all.","Aleksandr Shilovich<br>Moscow, russia, Russia<br><br>It is nice to know that there are people who share the spirit of<br>international collaboration!","Phil Roche<br>Mont-royal, Canada<br><br>Glad this opens bio research for all","Jennifer Hsieh<br>Puerto varas, Chile<br><br>I'm not sure how Chile customs deals with glycerol stocks. Normally we<br>get lyophilized DNA without problems, but I see that you have<br>delivered to Chile before and assume you know what to put on the<br>shipment page?     Thank you so much, if we can grow just some of<br>these enzymes ourselves it'd really help us decrease the cost of<br>development (which, naturally, is taking much longer than anyone ever<br>anticipates)","Neil Singh<br>G\u00f6ttingen, Germany<br><br>How will these items be shipped?  Is it the complete proteome?  What<br>are the downstream steps to be followed for gene extraction?  Would<br>you include the extre genes in Syn-3A?","Ian Cubit<br>Hagerstown, United states<br><br>Thank you!","Matthew Phanchana<br>Ratchathewi, Thailand<br><br>Replacement for order which arrived with the plate seal breached.<br>Original customer note follows:  I'm a lecturer at the Faculty of<br>Tropical Medicine Mahidol University in Thailand where we conduct<br>research in medical biosciences and provide postgraduate education. I<br>heard about the freegenes project f
